import React from "react";
import styled from "styled-components";
import NavBar from "../Components/NavBar";

const Home = () => {
  return (
    <div>
      <Background>
        <h1>안녕하세요</h1>
        <NavBar />
      </Background>
    </div>
  );
};

export default Home;

export const Background = styled.div`
  background: #fffcf4;
  width: 100%;
  hight: 100%;
  margin: 0;
  padding: 0;
`;
